import React, { useEffect, useState } from "react";
import Event from "./event";
import axios from "axios";
import { accessToken } from "./spotify";

function App() {
	const [token, setToken] = useState(null);
	useEffect(() => {
		setToken(accessToken);
	}, []);

	return (
		<div className="App">
			{!token ? (
				<Event />
			): <div> logged in!</div>}

		</div>
	);
}

export default App;
